  useEffect(() => {
    console.log(location.state.RecipeId);
  }, [location]);

  return (
    <div className={classes.root}>
      <div className={classes.header}>
        <Header />
      </div>
      <div className={classes.body}>hii</div>
    </div>
  );
}

export default Scene;
